import React from 'react';

export default function Loading() {
  return (
    <div className="d-flex justify-content-center mt-5 align-items-center" style={{ height: '100vh' }}>
      <div className="spinner-grow text-warning" role="status" style={{ height: '100px', width: '100px' }}>
        <span className="sr-only">Loading...</span>
      </div>
    </div>
  );
}
